css:
@-moz-document domain("chronos.iut-velizy.uvsq.fr") {
body {
    background-color: #1e1e1e;
    color: #000000;
}

table {
    background-color: #1e1e1e;
    color: #000000;
}

div {
    background-color: #1e1e1e;
    color: #000000;
}


thead {
    background-color: #8e8e8e;
    color: #000000;
}

tbody {
    background-color: #424242;
    color: #000000;
}

class {
    background-color: #acacac;
    color: #ff0e0e;
}

select {
    background-color: #515151;
    color: #fff;
}

a:link {
    background-color: #fff0;
    color: #d5d5d5;
}

a:visited {
    background-color: #fff0;
    color: #9f9f9f;
}

td {
    background-color: #fff0;
    color: #7b7b7b;
}

p.nav {
    background-color: #fff0;
    color: #e3e3e3;
}

h2 {
    color: #e3e3e3;
}

h3 {
    color: #e3e3e3;
}

h4 {
    color: #e3e3e3;
}
}
